package com.cocs.handler;import java.util.LinkedHashMap;public class ResponseResultImpl extends LinkedHashMap<String, Object> implements ResponseResult<String, Object> {	private static final long serialVersionUID = -670823905474058429L;	private ResponseResultImpl() {		super();	}		public ResponseResultImpl(String vendor) {		this();		put("vendor", vendor);	}	public void setResult(Object result){		put("result",result);	}	@Override	public Object getResult(){		return get("result");	}}